import React from 'react'
import { animate, motion } from 'framer-motion'

function RightSide() {
  return (
    <motion.div className='w-1/2  bg-blue-900'
        initial = {{
            y:"-100vw"
        }}
        animate = {{
            y:"0"   
        }}
        transition={{
            duration:0.8,

        }}
    >
        RightSide
    </motion.div>
  )
}

export default RightSide
